import React from 'react';
import { useNavigate } from 'react-router-dom';
import { Mail, GraduationCap, Building, Edit2, Settings, ArrowLeft, LogOut } from 'lucide-react';

const Profile = ({ user, theme, t }) => {
  const navigate = useNavigate();
  const isDark = theme === 'dark';

  const styles = {
    container: {
      padding: '20px',
      backgroundColor: isDark ? '#0f172a' : '#fff',
      minHeight: '100vh',
      maxWidth: '430px',
      margin: '0 auto',
      boxSizing: 'border-box',
      fontFamily: 'sans-serif'
    },
    header: {
      display: 'flex',
      justifyContent: 'space-between',
      alignItems: 'center',
      marginBottom: '30px'
    },
    headerTitle: {
      fontSize: '20px',
      fontWeight: 'bold',
      color: isDark ? '#fff' : '#1e293b'
    },
    profileCard: {
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      marginBottom: '30px'
    },
    avatar: {
      width: '100px',
      height: '100px',
      borderRadius: '50%',
      backgroundColor: '#2563eb',
      color: '#fff',
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
      fontSize: '40px',
      fontWeight: 'bold',
      marginBottom: '15px',
      boxShadow: '0 10px 20px rgba(37, 99, 235, 0.2)'
    },
    name: {
      fontSize: '24px',
      fontWeight: 'bold',
      color: isDark ? '#fff' : '#1e293b',
      marginBottom: '5px'
    },
    rollNo: {
      fontSize: '14px',
      color: '#64748b',
      backgroundColor: isDark ? '#1e293b' : '#f1f5f9',
      padding: '5px 12px',
      borderRadius: '20px',
      fontWeight: '600'
    },
    infoSection: {
      backgroundColor: isDark ? '#1e293b' : '#f8fafc',
      borderRadius: '20px',
      padding: '20px',
      border: isDark ? '1px solid #334155' : '1px solid #e2e8f0',
      marginBottom: '20px'
    },
    infoRow: {
      display: 'flex',
      alignItems: 'center',
      gap: '15px',
      marginBottom: '20px'
    },
    iconBox: {
      width: '40px',
      height: '40px',
      borderRadius: '10px',
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      flexShrink: 0
    },
    infoLabel: {
      fontSize: '12px',
      color: '#94a3b8',
      marginBottom: '2px'
    },
    infoValue: {
      fontSize: '16px',
      fontWeight: '600',
      color: isDark ? '#fff' : '#1e293b'
    },
    btn: {
      width: '100%',
      padding: '16px',
      borderRadius: '16px',
      border: 'none',
      fontSize: '16px',
      fontWeight: 'bold',
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      gap: '10px',
      cursor: 'pointer',
      marginBottom: '12px'
    }
  };

  return (
    <div style={styles.container}>
      {/* Header */}
      <div style={styles.header}>
        <div style={{ display: 'flex', alignItems: 'center', gap: '10px' }}>
          <ArrowLeft size={24} color={isDark ? '#fff' : '#1e293b'} onClick={() => navigate(-1)} style={{ cursor: 'pointer' }}/>
          <span style={styles.headerTitle}>Profile</span>
        </div>
        <Settings size={24} color={isDark ? '#fff' : '#1e293b'} onClick={() => navigate('/settings')} style={{ cursor: 'pointer' }} />
      </div>

      {/* Profile Avatar Card */}
      <div style={styles.profileCard}>
        <div style={styles.avatar}>
          {/* Gets first letter of the name the user typed */}
          {user.name.charAt(0)} 
        </div>
        
        {/* DISPLAY FULL NAME HERE */}
        <h2 style={styles.name}>{user.name}</h2>
        
        {/* DISPLAY ROLL NUMBER HERE */}
        <div style={styles.rollNo}>{user.regNo}</div>
      </div>

      {/* Details Section */}
      <div style={styles.infoSection}>
        <div style={styles.infoRow}>
          <div style={{ ...styles.iconBox, backgroundColor: '#e0f2fe', color: '#0ea5e9' }}>
            <Mail size={20} />
          </div>
          <div>
            <div style={styles.infoLabel}>Email Address</div>
            <div style={styles.infoValue}>{user.email}</div>
          </div>
        </div>

        <div style={styles.infoRow}>
          <div style={{ ...styles.iconBox, backgroundColor: '#dcfce7', color: '#16a34a' }}>
            <Building size={20} />
          </div>
          <div>
            <div style={styles.infoLabel}>College</div>
            <div style={styles.infoValue}>{user.college}</div>
          </div>
        </div>

        {/* Display Department if it exists */}
        {user.department && (
          <div style={{ ...styles.infoRow, marginBottom: 0 }}>
            <div style={{ ...styles.iconBox, backgroundColor: '#f3e8ff', color: '#9333ea' }}>
              <GraduationCap size={20} />
            </div>
            <div>
              <div style={styles.infoLabel}>Department</div>
              <div style={styles.infoValue}>{user.department}</div>
            </div>
          </div>
        )}
      </div>

      {/* Action Buttons */}
      <button 
        style={{ ...styles.btn, backgroundColor: '#2563eb', color: '#fff' }}
        onClick={() => navigate('/edit-profile')}
      >
        <Edit2 size={18} /> Edit Profile
      </button>

      <button 
        style={{ ...styles.btn, backgroundColor: '#fee2e2', color: '#ef4444' }}
        onClick={() => navigate('/settings')} // Redirects to settings where logout is
      >
        <LogOut size={18} /> Settings
      </button>
    </div>
  );
};

export default Profile;
